u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BC%D0%B0\" title=\"\u041b\u043e\u043c\u0430\">\u041b\u043e\u043c\u0435<\/a> \u0415\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u0438\u043c \u044d\u043a\u043e\u043d\u043e\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u043c \u0441\u043e\u043e\u0431\u0449\u0435\u0441\u0442\u0432\u043e\u043c (\u0441 1993&#160;\u0433.&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D0%B5%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%BE%D1%8E%D0%B7\" title=\"\u0415\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u0438\u0439 \u0441\u043e\u044e\u0437\">\u0415\u0421<\/a>) \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d\u0430 \u043f\u0435\u0440\u0432\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BC%D0%B5%D0%B9%D1%81%D0%BA%D0%B8%D0%B5_%D0%BA%D0%BE%D0%BD%D0%B2%D0%B5%D0%BD%D1%86%D0%B8%D0%B8\" title=\"\u041b\u043e\u043c\u0435\u0439\u0441\u043a\u0438\u0435 \u043a\u043e\u043d\u0432\u0435\u043d\u0446\u0438\u0438\">\u041b\u043e\u043c\u0435\u0439\u0441\u043a\u0430\u044f \u043a\u043e\u043d\u0432\u0435\u043d\u0446\u0438\u044f<\/a> \u043e\u0431 \u044d\u043a\u043e\u043d\u043e\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0438 \u0442\u043e\u0440\u0433\u043e\u0432\u044b\u0445 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044f\u0445 \u0441 46 \u0441\u0442\u0440\u0430\u043d\u0430\u043c\u0438 \u0410\u0444\u0440\u0438\u043a\u0438, \u0431\u0430\u0441\u0441\u0435\u0439\u043d\u043e\u0432 \u041a\u0430\u0440\u0438\u0431\u0441\u043a\u043e\u0433\u043e \u043c\u043e\u0440\u044f \u0438 \u0422\u0438\u0445\u043e\u0433\u043e \u043e\u043a\u0435\u0430\u043d\u0430 (\u0441\u0442\u0440\u0430\u043d\u044b \u0410\u041a\u0422).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1989_%D0%B3%D0%BE%D0%B4\" title=\"1989 \u0433\u043e\u0434\">1989<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BD%D0%B5%D1%81%D1%83%D1%8D%D0%BB%D0%B0\" title=\"\u0412\u0435\u043d\u0435\u0441\u0443\u044d\u043b\u0430\">\u0412\u0435\u043d\u0435\u0441\u0443\u044d\u043b\u0435<\/a> \u043f\u043e\u043b\u0438\u0446\u0438\u044f, \u0433\u0432\u0430\u0440\u0434\u0438\u044f \u0438 \u0430\u0440\u043c\u0438\u044f \u043f\u043e\u0434\u0430\u0432\u043b\u044f\u044e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%B0%D0%BA%D0%B0%D1%81%D0%BE\" title=\"\u041a\u0430\u0440\u0430\u043a\u0430\u0441\u043e\">\u0432\u043e\u043b\u043d\u0435\u043d\u0438\u044f, \u0432\u044b\u0437\u0432\u0430\u043d\u043d\u044b\u0435 \u043d\u0435\u043e\u043b\u0438\u0431\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u043c\u0438 \u0440\u0435\u0444\u043e\u0440\u043c\u0430\u043c\u0438<\/a> \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1990_%D0%B3%D0%BE%D0%B4\" title=\"1990 \u0433\u043e\u0434\">1990<\/a>&#160;\u2014 \u0441\u043e\u0437\u0434\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D1%8E%D0%B7_%D0%BA%D0%B8%D0%BD%D0%B5%D0%BC%D0%B0%D1%82%D0%BE%D0%B3%D1%80%D0%B0%D1%84%D0%B8%D1%81%D1%82%D0%BE%D0%B2_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8\" title=\"\u0421\u043e\u044e\u0437 \u043a\u0438\u043d\u0435\u043c\u0430\u0442\u043e\u0433\u0440\u0430\u0444\u0438\u0441\u0442\u043e\u0432 \u0420\u043e\u0441\u0441\u0438\u0438\">\u0421\u043e\u044e\u0437 \u043a\u0438\u043d\u0435\u043c\u0430\u0442\u043e\u0433\u0440\u0430\u0444\u0438\u0441\u0442\u043e\u0432 \u0420\u043e\u0441\u0441\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1991_%D0%B3%D0%BE%D0%B4\" title=\"1991 \u0433\u043e\u0434\">1991<\/a>&#160;\u2014 \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B2_%D0%9F%D0%B5%D1%80%D1%81%D0%B8%D0%B4%D1%81%D0%BA%D0%BE%D0%BC_%D0%B7%D0%B0%D0%BB%D0%B8%D0%B2%D0%B5\" title=\"\u0412\u043e\u0439\u043d\u0430 \u0432 \u041f\u0435\u0440\u0441\u0438\u0434\u0441\u043a\u043e\u043c \u0437\u0430\u043b\u0438\u0432\u0435\">\u0412\u043e\u0439\u043d\u0430 \u0432 \u041f\u0435\u0440\u0441\u0438\u0434\u0441\u043a\u043e\u043c \u0437\u0430\u043b\u0438\u0432\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1992_%D0%B3%D0%BE%D0%B4\" title=\"1992 \u0433\u043e\u0434\">1992<\/a>&#160;\u2014 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B8%D0%BF%D0%BB%D0%BE%D0%BC%D0%B0%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B5_%D0%BE%D1%82%D0%BD%D0%BE%D1%88%D0%B5%D0%BD%D0%B8%D1%8F\" title=\"\u0414\u0438\u043f\u043b\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044f\">\u0434\u0438\u043f\u043b\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044f<\/a> \u043c\u0435\u0436\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0424\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0435\u0439<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%B6%D0%BD%D0%BE-%D0%90%D1%84%D1%80%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u042e\u0436\u043d\u043e-\u0410\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u042e\u0436\u043d\u043e-\u0410\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0439 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1994_%D0%B3%D0%BE%D0%B4\" title=\"1994 \u0433\u043e\u0434\">1994<\/a>&#160;\u2014 \u043d\u0430\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%BD%D1%8F-%D0%9B%D1%83%D0%BA%D0%B0\" title=\"\u0411\u0430\u043d\u044f-\u041b\u0443\u043a\u0430\">\u0411