\"\u0421\u043e\u0446\u0438\u0430\u043b-\u0434\u0435\u043c\u043e\u043a\u0440\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f \u0423\u043a\u0440\u0430\u0438\u043d\u044b\">\u0421\u043e\u0446\u0438\u0430\u043b-\u0434\u0435\u043c\u043e\u043a\u0440\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f \u0423\u043a\u0440\u0430\u0438\u043d\u044b<\/a> (\u0421\u0414\u041f\u0423).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1998_%D0%B3%D0%BE%D0%B4\" title=\"1998 \u0433\u043e\u0434\">1998<\/a>&#160;\u2014 \u0432\u043e\u043e\u0440\u0443\u0436\u0451\u043d\u043d\u044b\u0439 \u043a\u043e\u043d\u0444\u043b\u0438\u043a\u0442, \u0432\u0441\u043f\u044b\u0445\u043d\u0443\u0432\u0448\u0438\u0439 \u0438\u0437-\u0437\u0430 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0430\u043b\u044c\u043d\u044b\u0445 \u043f\u0440\u0438\u0442\u044f\u0437\u0430\u043d\u0438\u0439 \u0430\u043b\u0431\u0430\u043d\u0446\u0435\u0432 \u043d\u0430 \u0441\u0435\u0440\u0431\u0441\u043a\u0438\u0439 \u043a\u0440\u0430\u0439 \u041a\u043e\u0441\u043e\u0432\u043e \u0438 \u041c\u0435\u0442\u043e\u0445\u0438\u044f&#160;\u2014 \u041a\u043e\u0441\u043e\u0432\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430.<\/li><\/ul><h3>XXI \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2010\" class=\"mw-redirect\" title=\"2010\">2010<\/a>&#160;\u2014 \u043d\u0430 \u0441\u0442\u0430\u0434\u0438\u043e\u043d\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8-%D0%A1%D0%B8_%D0%9F%D0%BB%D1%8D%D0%B9%D1%81\" title=\"\u0411\u0438-\u0421\u0438 \u041f\u043b\u044d\u0439\u0441\">\u0411\u0438-\u0421\u0438 \u041f\u043b\u044d\u0439\u0441<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D0%BD%D0%BA%D1%83%D0%B2%D0%B5%D1%80\" title=\"\u0412\u0430\u043d\u043a\u0443\u0432\u0435\u0440\">\u0412\u0430\u043d\u043a\u0443\u0432\u0435\u0440\u0435<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0\" title=\"\u041a\u0430\u043d\u0430\u0434\u0430\">\u041a\u0430\u043d\u0430\u0434\u0430<\/a>) \u043f\u0440\u043e\u0448\u043b\u0430 \u0446\u0435\u0440\u0435\u043c\u043e\u043d\u0438\u044f \u0437\u0430\u043a\u0440\u044b\u0442\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B8%D0%BC%D0%BD%D0%B8%D0%B5_%D0%9E%D0%BB%D0%B8%D0%BC%D0%BF%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B5_%D0%B8%D0%B3%D1%80%D1%8B_2010\" title=\"\u0417\u0438\u043c\u043d\u0438\u0435 \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0435 \u0438\u0433\u0440\u044b 2010\">\u0417\u0438\u043c\u043d\u0438\u0445 \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0445 \u0438\u0433\u0440<\/a>. \u0422\u0430\u043a\u0436\u0435 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0430 \u043f\u0435\u0440\u0435\u0434\u0430\u0447\u0430 \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u0444\u043b\u0430\u0433\u0430 \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D0%BD%D0%BA%D1%83%D0%B2%D0%B5%D1%80\" title=\"\u0412\u0430\u043d\u043a\u0443\u0432\u0435\u0440\">\u0412\u0430\u043d\u043a\u0443\u0432\u0435\u0440\u0430<\/a> \u0441\u0442\u043e\u043b\u0438\u0446\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B8%D0%BC%D0%BD%D0%B8%D0%B5_%D0%9E%D0%BB%D0%B8%D0%BC%D0%BF%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B5_%D0%B8%D0%B3%D1%80%D1%8B_2014\" title=\"\u0417\u0438\u043c\u043d\u0438\u0435 \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0435 \u0438\u0433\u0440\u044b 2014\">\u0417\u0438\u043c\u043d\u0438\u0445 \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0445 \u0438\u0433\u0440 2014<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D1%87%D0%B8\" title=\"\u0421\u043e\u0447\u0438\">\u0421\u043e\u0447\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2013\" class=\"mw-redirect\" title=\"2013\">2013<\/a>&#160;\u2014 \u043e\u0442\u0440\u0435\u0447\u0435\u043d\u0438\u0435 \u043e